import { Text ,Icon } from "./components/atoms";

function App() {
  return (
    <>
      <div className="w-24">
        <Text textAlign="center"  bold  color="primary"  classeName="">I love you sooo much</Text>
      </div>   
      <Icon name="home" className="text-white "/>
    </>
  );
}

export default App;


